            // Game Topic
            DataService.SubmitDataChange(new GameTopic { ID = 1, Name = "Why aren't there classes?", Text = "We made a deliberate design decision to make SWLOR a skill-based game from the beginning. This was done so that players can feel like they have complete control over their character. We didn't want to force players into a specific archetype even though many other games do. Our approach is to give players the tools they need to play how they want and then let them decide on how to beat challenges.", GameTopicCategoryID = 4, IsActive = true, Sequence = 1, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 2, Name = "Why isn't 'XYZ' race available?", Text = "Race options are largely based on what models and content we have available. NWN is a fantasy game so the amount of Star Wars specific content can be lacking at times (though there's a lot more than one might think!). With all that said, if you come across content that would make a good fit for the server - and we don't already have it - then please be sure to let us know on Discord.", GameTopicCategoryID = 4, IsActive = true, Sequence = 2, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 3, Name = "Is this server like 'ABC' game?", Text = "We take a lot of inspiration from games like Star Wars Galaxies, Skyrim, Eve Online and Star Wars: The Old Republic. However, we have added our own spin on things to keep it interesting. You will most certainly find things we've generously 'borrowed' from other games, but you will also find a lot of unique things as well.", GameTopicCategoryID = 4, IsActive = true, Sequence = 3, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 4, Name = "Is this a Roleplay server?", Text = "Yes. We are a roleplay server. This means you are expected to create a character and act as if you were him/her in the setting. This means leaving conversations like who won the football game, real-world politics, and other such topics out of public chat channels. If you need to speak 'out of character' we recommend using Discord or the private 'tell' chat in-game.", GameTopicCategoryID = 4, IsActive = true, Sequence = 4, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 5, Name = "Where should I send suggestions?", Text = "We welcome all ideas and suggestions. We'll even be happy to take **constructive** criticism too! The best place to do this is on our Discord channel. Be sure to put it in the appropriate channel. Keep in mind that just because you suggest something doesn't mean it will be implemented. The best way to get your idea implemented is to do it yourself. Our code is open source and freely available. We can help you with forking the repository and submitting a pull request. Just ask us in Discord!", GameTopicCategoryID = 4, IsActive = true, Sequence = 5, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 6, Name = "Where can I donate?", Text = "If you'd like to donate money toward server costs please visit our Patreon here: https://www.patreon.com/swlor \n\nWe are committed to a fair gameplay experience for everyone. For that reason, donations will *never* give you in-game rewards. By donating, you understand you are simply helping us foot the bill for the monthly hosting costs.", GameTopicCategoryID = 4, IsActive = true, Sequence = 6, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 7, Name = "How can I contribute?", Text = "We're really appreciative of all (non-monetary) donations. If you've built a cool area, or developed a neat feature or quest please consider donating it to the server. Our source code and module are open source and available on GitHub. If your contribution is code-related, simply create a pull request on GitHub. If your contribution is an area, item, or something else module-based please get in touch with the DM team to see how you can add it. If you need help, please get in touch with us on Discord.", GameTopicCategoryID = 4, IsActive = true, Sequence = 7, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 8, Name = "What if your mod gets stolen?", Text = "Some people question why we have chosen to make the project open source. We've chosen this approach because we feel it actually enhances the server for everyone. There have been many enhancements and features created for the server because it's freely available. Although we'd prefer everyone to play on our server and consider it the 'official' version, we're more than happy to see our work used. If you make something cool on your version, consider contributing it to us - it will probably make its way in!", GameTopicCategoryID = 4, IsActive = true, Sequence = 8, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 9, Name = "Jedi Padawan (Guardian)", Text = "Temporary Bonus: Basic Lightsaber\nPermanent Bonus: +2 Base Attack Bonus when equipped with lightsabers", GameTopicCategoryID = 3, IsActive = false, Sequence = 2, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 10, Name = "Jedi Padawan (Sentinel)", Text = "Temporary Bonus: Basic Saberstaff\nPermanent Bonus: +2 Base Attack Bonus when equipped with saberstaffs", GameTopicCategoryID = 3, IsActive = false, Sequence = 3, Icon = "" }, DatabaseActionType.Insert);
            DataService.SubmitDataChange(new GameTopic { ID = 11, Name = "Rule #1 - Role Play", Text = "You are expected to role play in all interactions with players and DMs. You may not use famous characters, unearned titles or character concepts which are harmful to the world (e.g. Luke Skywalker, Revan or Darth Vader). Character concepts may be rejected at a DM’s discretion and you are expected to remake without complaint.", GameTopicCategoryID = 7, IsActive = true, Sequence = 1, Icon = "" }, DatabaseActionType.Insert);
